import React from "react";
import {NavLink} from "react-router-dom";

const Navbar = () =>{
    return(
        <>
        <nav className="flex sm:justify-center space-x-4">
           <NavLink  to="/" activeClassName={{color:'red'}} className="rounded-lg px-3 py-2 text-slate-700 font-medium hover:bg-slate-100 hover:text-slate-900"> About Us </NavLink>
           {' '}
           <NavLink  to="contact" className="rounded-lg px-3 py-2 text-slate-700 font-medium hover:bg-slate-100 hover:text-slate-900"> Contact Us </NavLink>
           <NavLink  to="pokeApi" className="rounded-lg px-3 py-2 text-slate-700 font-medium hover:bg-slate-100 hover:text-slate-900"> PokeApi </NavLink>
           <NavLink  to="covid19" className="ani animate-pulse rounded-lg px-3 py-2 text-slate-700 font-medium hover:bg-slate-100 hover:text-slate-900"> Covid Tracker </NavLink>
        </nav>
           
        </>
    )
}

export default Navbar;
